import React from 'react';
import { motion } from 'framer-motion';

function BikeCard({ bike }) {
  return (
    <motion.div
      whileHover={{ scale: 1.05 }}
      whileTap={{ scale: 0.95 }}
      className="p-4 rounded shadow-lg bg-white dark:bg-gray-800"
    >
      <img src={bike.imageUrl} alt={bike.model} className="w-full h-40 object-cover rounded" />
      <h3 className="text-lg font-semibold mt-2">{bike.model}</h3>
      <p className="text-gray-600 dark:text-gray-300">₹{bike.price}/day</p>
      <button className="mt-2 px-4 py-1 bg-blue-500 text-white rounded hover:bg-blue-600">Book Now</button>
    </motion.div>
  );
}

export default BikeCard;
